import "./App.css";

function App() {
  const name = "Tom";
  return (
    <div className="App">
      <h1
        style={{
          color: "#f0f",
          backgroundColor: "green",
        }}
      >
        Hello, {name}
      </h1>
    </div>
  );
}

export default App;
